When detective Johnny Sins goes missing, his partner Scott Nails begins investigating a circle of female vampires who although seem very sweet on the outside, carry a very dark hunger deep within. Scott is pulled into a world of assassination, debauchery and the supernatural.Unwilling to stay buried, Lust Bite has risen from the grave to bring you all 3 episodes on one DVD!Episode 1: An Inconvenient TruceEpisode 2: Tonight, We FeastEpisode 3: The Queen of LustADDITIONAL FOOTAGEAlready bursting at the seams with desire and debauchery, Brazzers is pleased to give all you daywalkers even more hot vampire sensuality in extended versions of the series sexy scenes.Starring: Lisa Ann, Asa Akira, Diamond Foxxx, and Jessica Jaymes.
